export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:f,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:f,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:f,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},Q5m8Pc6iJF:{data:{id:2386,attributes:{imdbId:"tt2372220",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTA4ODgxMjEzNjNeQTJeQWpwZ15BbWU4MDY0MjAzMDAx._V1_SX300.jpg",type:e,ratings:[{Source:"Internet Movie Database",Value:"7.8\u002F10"}],item_lang:{data:{id:3049,attributes:{title:h,plot:"A portrayal of one of the most dramatic and turbulent times in English history. A story of love and lust, seduction and deception, betrayal and murder, it is uniquely told through the perspective of three different, yet equally relentless women - Elizabeth Woodville, Margaret Beaufort and Anne Neville. In their quest for power, they will scheme, manipulate and seduce their way onto the English throne. The year is 1464, before the Tudor dynasty ruled the country, and war has been ravaging throughout England over who is the rightful King. It is a bitter dispute between two sides of the same family, The House of York and The House of Lancaster. The House of York's young and handsome Edward IV is crowned King of England with the help of the master manipulator, Lord Warwick \"The Kingmaker.\" But when Edward falls in love with a beautiful Lancastrian commoner, Elizabeth Woodville, Warwick's plan to control the throne comes crashing down. A violent, high-stakes struggle ensues between Elizabeth, her most fierce adversary, Lancastrian Margaret Beaufort, and Anne Neville, the pawn in her father's power game - each woman vying for the crown.",slug:"the-white-queen"}}},books:{data:[{id:11593,attributes:{title:h,description:"A tale of the Wars of the Roses follows Elizabeth Woodville, who ascends to royalty and fights for the well-being of her family, including two sons whose imprisonment in the Tower of London precedes a devastating unsolved mystery.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jFU6WTR1yB0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2013-07-09",publisher:c,subtitle:a}},{id:11594,attributes:{title:"Cousins' War Collection",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=u-m-oQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Phillipa Gregory"],firstBook:d,published:"2014-08-14",publisher:a,subtitle:a}},{id:11595,attributes:{title:"The White Princess",description:"Passionately in love with Richard III in spite of her arranged marriage to pretender to the throne Henry Tudor, Princess Elizabeth of York is forced to marry the man who murdered her lover and create a royal family under the controlling gaze of his mother, Margaret Beaufort.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BZ9vDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2017-03-28",publisher:c,subtitle:a}},{id:11596,attributes:{title:"The Other Queen",description:"Presents a tale inspired by the story of Mary, Queen of Scots, in a work that follows the doomed monarch's long imprisonment in the household of the Earl of Shrewsbury and his spying wife, Bess.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=r5fjcDEWNQQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2008-09-16",publisher:c,subtitle:"A Novel"}},{id:11597,attributes:{title:"Philippa Gregory's The Cousins' War 3-Book Boxed Set",description:"The Red Queen In a novel of conspiracy, passion, and coldhearted ambition, number one bestselling author Philippa Gregory has brought to life the story of a proud and determined woman who believes that she alone is destined, by her piety and lineage, to shape the course of history. In The Red Queen, Gregory illuminates the fascinating woman who founded England’s most powerful ruling line, the Tudors: Margaret Beaufort. The White Queen Elizabeth Woodville, a woman of extraordinary beauty and ambition, secretly marries the newly crowned boy king of England. While she rises to the demands of her exalted position and fights for the success of her family, her two sons become the central figures in a famous unsolved mystery that has confounded historians for centuries: the lost princes in the Tower of London. Philippa Gregory brings the artistry and intellect of a master writer and storyteller to a new era in history and begins what is sure to be another bestselling classic series. The Lady of the Rivers The Lady of the Rivers is #1 New York Times bestselling author Philippa Gregory’s remarkable story of Jacquetta, Duchess of Bedford, a woman who navigated a treacherous path through the battle lines in the Wars of the Roses.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PwoZFyMLY2oC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2011-12-20",publisher:c,subtitle:"The Red Queen, The White Queen, and The Lady of the Rivers"}}]}}},meta:{}}},prerenderedAt:1681703425415}}("","Philippa Gregory","Simon and Schuster",null,"series","movie",1,"The White Queen"))